let inp1 = [(true,(10,12),(10,12),(10,12));(true,(11,13),(11,13),(11,13));(false,(9,11),(9,11),(9,11));(true,(10,10),(10,10),(10,10))]

let calc inp =
	let data = Array.make (101*101*101) false in
	for i = 0 to List.length inp - 1 do
		let (on, (x1,x2), (y1,y2), (z1,z2)) = List.nth inp i in
		if x1 >= -50 && x2 <= 50 && y1 >= -50 && y2 <= 50 && z1 >= -50 && z2 < 50 then
    		for a = x1 to x2 do
    			for b = y1 to y2 do
    				for c = z1 to z2 do
    					data.((a+50)*101*101+(b+50)*101+(c+50)) <- on;
    				done;
    			done;
    		done;
	done;
	let c = ref 0 in
	for i = 0 to 100 do
		for j = 0 to 100 do
			for k = 0 to 100 do
				if data.(i*101*101+j*101+k) then c := !c + 1
			done;
		done;
	done;
	!c;;

Printf.printf "%d\n" (calc inp);;

let vol ((x1,x2),(y1,y2),(z1,z2)) = if x2 >= x1 && y2 >= y1 && z2 >= z1 then (x2-x1+1)*(y2-y1+1)*(z2-z1+1) else 0

let min a b = if a < b then a else b
let max a b = if a > b then a else b
let intersect ((x1,x2), (y1,y2), (z1,z2)) ((a1,a2), (b1,b2), (c1,c2)) = ((max a1 x1, min a2 x2),(max b1 y1,min b2 y2),(max c1 z1,min c2 z2))

let rec calc2 inp =
	let s = ref 0 in
	for i = 0 to List.length inp - 1 do
		let (on, (x1,x2), (y1,y2), (z1,z2)) = List.nth inp i in
		if on then
			(s := !s + vol ((x1,x2), (y1,y2), (z1,z2));
			let cubes = ref [] in
			for j = i + 1 to List.length inp - 1 do
				let (_, (a1,a2), (b1,b2), (c1,c2)) = List.nth inp j in
				let ((m1,m2),(n1,n2),(o1,o2)) = (intersect ((x1,x2), (y1,y2), (z1,z2)) ((a1,a2), (b1,b2), (c1,c2))) in
			    if vol ((m1,m2),(n1,n2),(o1,o2)) > 0 then
				    cubes := (true, (m1,m2),(n1,n2),(o1,o2)) :: !cubes;
			done;
			s := !s - calc2 (!cubes);)
	done;
	!s;;

Printf.printf "%d\n" (calc2 inp)
